(115, 1, '2024-07-13 22:32:58', '2024-07-13 22:32:58', '<label> Tu nombre\r\n    [text* your-name autocomplete:name] </label>\r\n\r\n<label> Tu correo electrónico\r\n    [email* your-email autocomplete:email] </label>\r\n\r\n<label> Asunto\r\n    [text* your-subject] </label>\r\n\r\n<label> Tu mensaje (opcional)\r\n    [textarea your-message] </label>\r\n\r\n[submit \"Enviar\"]\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@gymfitness.test>\n[_site_admin_email]\nDe: [your-name] [your-email]\r\nAsunto: [your-subject]\r\n\r\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n-- \r\nEsto es un aviso de que se ha enviado un formulario de contacto en tu web ([_site_title] [_site_url]).\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@gymfitness.test>\n[your-email]\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n-- \r\nEste correo electrónico es un acuse de recibo del envío de tu formulario de contacto en tu web ([_site_title] [_site_url]) en la que se usó tu dirección de correo electrónico. Si no eres tú, por favor, ignora este mensaje.\nReply-To: [_site_admin_email]\n\n\n\nGracias por tu mensaje. El mensaje ha sido enviado.\nHubo un error al intentar enviar su mensaje. Por favor inténtelo más tarde.\nUno o más campos tienen un error. Por favor revíselo y reinténtelo.\nHubo un error al intentar enviar su mensaje. Por favor inténtelo más tarde.\nDebe aceptar los términos y condiciones antes de enviar su mensaje.\nPor favor, rellena este campo.\nEste campo tiene una entrada demasiado larga.\nEste campo tiene una entrada demasiado corta.\nSucedió un error desconocido al subir el archivo.\nNo se le permite subir archivos de este tipo.\nEl archivo subido es demasiado grande.\nOcurrió un error al subir el archivo.\nPor favor, introduce una fecha con el formato YYYY-MM-DD.\nEste campo tiene una fecha demasiado temprana.\nEste campo tiene una fecha demasiado tardía.\nPor favor, introduce un número.\nEste campo tiene un número demasiado pequeño.\nEste campo tiene un número demasiado grande.\nLa respuesta al quiz es incorrecta.\nPor favor, introduce una dirección de correo electrónico.\nPor favor, introduce una URL.\nPor favor, introduce un número de teléfono.', 'Formulario de contacto', '', 'publish', 'closed', 'closed', '', 'formulario-de-contacto', '', '', '2024-07-13 22:32:58', '2024-07-13 22:32:58', '', 0, 'http://gymfitness.test/?post_type=wpcf7_contact_form&p=115', 0, 'wpcf7_contact_form', '', 0),
